import React, { useState, useEffect } from "react";
import Box from "./Box";
import "./Container.css";
import AA from "./AA/AA";
import MFI from "./MFI/MFI";
import Pagination from "../Pagination/Pagination";
import Plant from "./Plant/Plant";
import { Plants } from "../../Services/Json";

function Container(prop) {
  const [currentPage, setCurrentPage] = useState(1);
  const itemsPerPage = 2;
    console.log(prop.plantDetails);
    const [plantData,setPlantData]=useState({});
  // Dummy data for testing
  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await Plants();
        setPlantDetails(response);
        // const plantNames = response.map((ele) => ele.plantName);
        // setOptions(plantNames);
        // console.log("options"+options);
      } catch (error) {
        console.error(error);
      }
    };

    fetchData();
  }, []);
  const dummyData = [
    { id: 1, name: "Item 1" },
    { id: 2, name: "Item 2" },
    { id: 3, name: "Item 3" },
    { id: 4, name: "Item 4" },
    { id: 5, name: "Item 5" },
    { id: 6, name: "Item 6" },
    { id: 7, name: "Item 7" },
    { id: 8, name: "Item 8" },
    { id: 9, name: "Item 9" },
    { id: 10, name: "Item 10" },
  ];

  useEffect(() => {
    const interval = setInterval(() => {
      const totalPages = Math.ceil(plantData.machineGroups.length / itemsPerPage);
      setCurrentPage((prevPage) => (prevPage % totalPages) + 1);
    }, 5000);

    return () => clearInterval(interval);
  }, [itemsPerPage, plantData.machineGroups.length]);

  const handlePageChange = (pageNumber) => {
    setCurrentPage(pageNumber);
  };

  const indexOfLastItem = currentPage * itemsPerPage;
  const indexOfFirstItem = indexOfLastItem - itemsPerPage;
  const currentItems = plantData.machineGroups.slice(indexOfFirstItem, indexOfLastItem);
console.log("ct"+currentItems);
  return (
    <div>
      <div className="wholeContainer">
        <div className="container">
         <Plant currentItems={currentItems}/>
        </div>

        <div className="seccon">
          <div className="AA">
            <AA />
          </div>
          <div className="MFI">
            <MFI />
          </div>
        </div>
      </div>
      <div className="footer1">
        <div className="Pagination">
          <Pagination
            items={plantData.machineGroups}
            currentPage={currentPage}
            itemsPerPage={itemsPerPage}
            onPageChange={handlePageChange}
          />
        </div>
      </div>
      <div className="footer2">
        <div className="indicator1">
          <div className="circle1" style={{ background: "rgb(100, 221, 23)" }}></div>
          <div className="author1">
            <p>Health Score &gt; 80%</p>
          </div>
          <div className="circle1" style={{ background: "rgb(255, 193, 7)" }}></div>
          <div className="author1">
            <p>Health Score &gt; 50% &lt; 80%</p>
          </div>
          <div className="circle1" style={{ background: "rgb(255, 87, 34)" }}></div>
          <div className="author1">
            <p>Health Score &lt; 50%</p>
          </div>
          <div className="circle1" style={{ border: "solid 1px black" }}></div>
          <div className="author1">
            <p>Health Score Not Available</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Container;
